// Компонент Blog
import React from 'react';

function Blog({ blog, onDelete }) {
  if (!blog) {
    return null;
  }

  const handleDelete = () => {
    // Вызовите onDelete, если он передан
    if (onDelete) {
      onDelete(blog.id); // или используйте другой способ идентификации блога
    }
  };

  return (
    <section className="blog">
      {/* ... (остальной код компонента Blog) */}
      <button className="delete" onClick={handleDelete}>
        <img src="/img/delete.png" alt="Delete Blog" />
      </button>
    </section>
  );
}

export default Blog;
